(34, 'POST_YL84ZA3OGH', 'The Book of Boba Fett คัมภีร์แห่งโบบาเฟตต์..', 'egPPcLibk9siUPnZomdiJC-6438246ead577.jpg', 'ดูหนังกับหมี... สามารถติดตามต่อได้ที่', 7279020402, 7279020402, '<p>รู้ก่อนชม “The Book of Boba Fett”</p><p>ในอดีตกาลนานมาแล้ว “แจงโก้ เฟตต์” นักล่าค่าหัวชาวแมนดาลอ ได้ตกลงรับการว่าจ้างจากชาวดาวคามิโน ให้เป็นต้นแบบการผลิตกองทัพมนุษย์โคลน โดยแลกกับการปั๊มตัวโคลนที่เหมือนกับเขาในช่วงเยาว์วัย เพื่อนำมาเลี้ยงดูราวกับเป็นลูกชายคนโปรด เขาฝึกฝนลูกคนนี้ให้แข็งแกรงก่อนจะให้ชื่อว่า “โบบา เฟตต์” แต่เพราะ แจงโก้ ไปมีส่วนเกี่ยวข้องกับการทำให้เกิดสงครามโคลนเขาจึงถูก อาจาย์เจได “วินดู” ผู้ถือไลท์เซเบอร์สีม่วงสังหารด้วยการบั่นคอ เรื่องนี้ทำให้เด็กหนุ่ม โบบา ยอมไม่ได้พยายามติดตามไปแก้แค้นแต่สุดท้ายก็ทำไม่สำเร็จ เขาจึงมุ่งมั่นฝึกฝนตนเองเพื่อก้าวเข้าสู่การเป็นนักล่าค่าหัวแบบผู้เป็นพ่อ... สามารถติดตามต่อได้ที่ : <a href=\"https://www.dailynews.co.th/articles/637904/\" target=\"_blank\">https://www.dailynews.co.th/articles/637904/</a></p><p><br></p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"ดูหนังกับหมี-ปก-2-768x433.jpg\" style=\"width: 768px;\"><br></p>', 1, 5, 0, '2023-04-13', '2023-04-13');
