นใจคือชื่อที่นำมาตั้งสินค้าเหล่านั้นได้ผสมผสานภาษาบาลี-สันสกฤต ที่มีความเป็นไทย และสากลมาใช้ตั้งชื่ออย่างเช่น คีย์บอร์ดเกมมิ่ง Loga Asura (อสุรา) หรือ เมาส์เกมมิ่ง Loga Deva (เดวา) ที่เอาคาแรคเตอร์ของเทพ และอสูรออกมาจับคู่กลายเป็นเมาส์คีย์บอร์ด หรืออย่างแผ่นรองเมาส์ Mantra (มันตรา) ก็ได้ชื่อที่ฟังคุ้นหูชาวไทยเป็นอย่างดี นอกจากชื่อและลวดลายที่เป็นเอกลักษณ์แล้ว Loga มีสินค้าไหนที่น่าสนใจอีกบ้าง ต้องมาดูกันครับ</p><p style=\"box-sizing: inherit; -webkit-tap-highlight-color: transparent; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; line-height: 22px;\"><br style=\"box-sizing: inherit; -webkit-tap-highlight-color: transparent;\"></p></div></div></div></div></div><div class=\"MuiBox-root css-0\" style=\"box-sizing: inherit; -webkit-tap-highlight-color: transparent; color: rgb(33, 43, 54); font-family: NotoSans-Thai, sans-serif;\"><div class=\"MuiBox-root css-1b6m7hw\" id=\"text-22\" style=\"box-sizing: inherit; -webkit-tap-highlight-color: transparent; position: relative; top: -150px;\"></div><div class=\"PrivateHiddenCss-root css-0\" style=\"box-sizing: inherit; -webkit-tap-highlight-color: transparent;\"><div class=\"MuiContainer-root MuiContainer-maxWidthLg text-editor css-3b8bix\" style=\"-webkit-tap-highlight-color: transparent; width: 1280px; margin-left: auto; margin-right: auto; padding-left: 0px; padding-right: 0px; margin-bottom: 0px; max-width: 1280px; padding-bottom: 24px;\"><div class=\"ql-editor css-17yv3f5\" id=\"editor\" style=\"-webkit-tap-highlight-color: transparent; line-height: 1.42; height: 336px; outline: none; overflow: hidden; padding: 0px; tab-size: 4; white-space: pre-wrap; overflow-wrap: break-word; margin-top: 0px;\"><div style=\"box-sizing: inherit; -webkit-tap-highlight-color: transparent; cursor: text;\"><h3 style=\"box-sizing: inherit; -webkit-tap-highlight-color: transparent; margin-right: 0px; margin-bottom: 0px; mar